<!DOCTYPE html>
<html lang="en">
<head>
<meta charset="utf-8" />
<meta name="viewport" content="width=device-width, initial-scale=1" />
<title>High Meter â€” Tap Game (with Jumpscare)</title>
<style>
  :root {
    --bg:#0b0b0b;
    --text:#e7e7e7;
    --accent:#22e36e;
    --muted:#8f8f8f;
    --danger:#ff5252;
  }
  * { box-sizing: border-box; }
  html, body { margin:0; height:100%; background:var(--bg); color:var(--text); overflow:hidden; touch-action:manipulation; -webkit-user-select:none; user-select:none; font-family: system-ui, -apple-system, Segoe UI, Roboto, Arial, sans-serif; }

  #game { position:relative; width:100vw; height:100vh; display:flex; flex-direction:column; }

  header { display:flex; align-items:center; justify-content:space-between; padding:10px 14px; background:rgba(255,255,255,.03); border-bottom:1px solid rgba(255,255,255,.07); }
  .stat { font-weight:700; }
  .muted { color:var(--muted); }

  /* Blunt timer SVG */
  #timerWrap { position:relative; width:100%; height:46px; }
  svg.blunt { position:absolute; left:50%; transform:translateX(-50%); height:46px; width:min(92vw, 720px); }
  .smoke { opacity:.75; mix-blend-mode:screen; }

  main { flex:1; position:relative; display:flex; align-items:center; justify-content:center; }
  #hitBtn {
    position:absolute; left:50%; top:55%; transform:translate(-50%,-50%);
    padding:16px 22px; border-radius:16px; border:1px solid rgba(255,255,255,.14);
    background:radial-gradient(100% 100% at 50% 0%, #2ef2a7 0%, #1fb56d 80%); color:#04140b;
    font-weight:800; letter-spacing:.5px; font-size:18px;
    box-shadow:0 8px 24px rgba(46,242,167,.2), inset 0 1px 0 rgba(255,255,255,.35);
  }
  #puff { position:absolute; width:24px; height:24px; border-radius:50%; background:#eef; opacity:0; pointer-events:none; }

  /* Meter */
  #meterWrap { position:absolute; bottom:20px; left:50%; transform:translateX(-50%); width:min(92vw, 680px); }
  #meterBase { height:14px; border-radius:999px; background:linear-gradient(90deg,#122,#233); border:1px solid rgba(255,255,255,.12); overflow:hidden; }
  #meterFill { height:100%; width:0%; background:linear-gradient(90deg,#37ff96,#0aff64 60%,#a6ffd1); box-shadow:0 0 18px rgba(55,255,150,.4); transition:width .15s; }

  /* Overlays */
  .overlay { position:fixed; inset:0; display:grid; place-items:center; background:rgba(0,0,0,.9); z-index:20; }
  #startOverlay { z-index:30; background:radial-gradient(1200px 600px at 50% 30%, rgba(0,255,180,.05), rgba(0,0,0,.92) 60%); }
  .card { text-align:center; padding:26px 18px; background:rgba(255,255,255,.04); border:1px solid rgba(255,255,255,.1); border-radius:16px; width:min(92vw, 540px); }
  .big { font-size:26px; font-weight:800; margin-bottom:6px; }
  .sub { color:var(--muted); margin-bottom:16px; }
  .btn { background:#101010; color:#fff; border:1px solid rgba(255,255,255,.2); padding:14px 18px; border-radius:12px; font-weight:800; }
  .btn:active { transform:scale(.98); }
  .hidden { display:none; }

  /* JUMPSCARE */
  #jumpscare { position:fixed; inset:0; background:#000; z-index:50; display:none; }
  #blackFade { position:absolute; inset:0; background:#000; opacity:0; }
  #faceWrap { position:absolute; inset:0; display:grid; place-items:center; opacity:0; }
  #face { width:100vw; height:100vh; object-fit:contain; filter:brightness(.4) contrast(1); }
  .eye { position:fixed; width:64px; height:64px; border-radius:50%; background:radial-gradient(circle at center, rgba(255,0,0,1) 0%, rgba(255,0,0,.9) 40%, rgba(255,0,0,.2) 70%, rgba(255,0,0,0) 100%); mix-blend-mode:screen; filter:blur(1px); opacity:0; pointer-events:none; }
  /* tweak these if needed on device */
  #eyeL { left:41%; top:41%; }
  #eyeR { left:60%; top:41%; }

  #static { position:absolute; inset:-50%; background:
      repeating-linear-gradient(0deg, rgba(255,255,255,.02), rgba(255,255,255,.02) 2px, transparent 2px, transparent 4px),
      repeating-linear-gradient(90deg, rgba(255,255,255,.02), rgba(255,255,255,.02) 2px, transparent 2px, transparent 3px);
      opacity:0; pointer-events:none; }

  @keyframes eyePulse { 0%,100% { opacity:.6; transform:scale(1.05); } 50% { opacity:1; transform:scale(1.25); } }
  @keyframes eyeBurn  { from { filter:blur(2px) saturate(1); } to { filter:blur(0) saturate(4); } }
  @keyframes flicker  { 0%,100% { opacity:0; } 10% { opacity:.15; } 20% { opacity:.05; transform:translate(1px,-1px);}
                        30% { opacity:.25; transform:translate(-1px,1px);}
                        50% { opacity:.3; transform:translate(1px,1px);} 90% { opacity:.18; } }
  @keyframes glitch   { 0%,100% { transform:translate(0,0) scale(1); }
                        25% { transform:translate(-4px,3px) scale(1.03) skewX(3deg);}
                        50% { transform:translate(3px,-2px) scale(1.06);}
                        75% { transform:translate(-2px,1px) scale(1.02);}
                      }
  .glitch { animation:glitch .25s infinite steps(2,end); }
  #tapRestart { position:fixed; bottom:24px; left:50%; transform:translateX(-50%); color:#f33; font-weight:800; letter-spacing:.5px; }
</style>
</head>
<body>
  <div id="game">
    <header>
      <div class="stat">Hits: <span id="score">0</span> / <span id="target">30</span></div>
      <div class="muted">Burn timer</div>
    </header>

    <div id="timerWrap">
      <svg class="blunt" viewBox="0 0 900 100">
        <defs>
          <linearGradient id="wrapGrad" x1="0" x2="1">
            <stop offset="0%" stop-color="#c9b694"/>
            <stop offset="50%" stop-color="#b7a27f"/>
            <stop offset="100%" stop-color="#9e8a66"/>
          </linearGradient>
          <linearGradient id="ashGrad" x1="0" x2="1">
            <stop offset="0%" stop-color="#444"/>
            <stop offset="100%" stop-color="#1f1f1f"/>
          </linearGradient>
        </defs>
        <!-- Wrapper -->
        <rect x="40" y="20" width="800" height="60" rx="30" ry="30" fill="url(#wrapGrad)" stroke="#5a4e38" stroke-width="3"/>
        <!-- Burn clip -->
        <clipPath id="burnMask">
          <rect id="burnRect" x="40" y="20" width="0" height="60" rx="30" ry="30"/>
        </clipPath>
        <!-- Ash revealed by clip -->
        <rect x="40" y="20" width="800" height="60" rx="30" ry="30" fill="url(#ashGrad)" clip-path="url(#burnMask)"/>
        <!-- Ember -->
        <g id="ember" class="smoke" transform="translate(0,0)">
          <circle cx="40" cy="50" r="20" fill="#ff9e00"/>
          <circle cx="40" cy="50" r="12" fill="#ff3b00"/>
          <circle cx="40" cy="50" r="8"  fill="#fff"/>
        </g>
      </svg>
    </div>

    <main>
      <button id="hitBtn">TAKE HIT</button>
      <div id="puff"></div>

      <div id="meterWrap">
        <div class="muted" style="margin-bottom:6px; font-weight:700;">High Meter</div>
        <div id="meterBase"><div id="meterFill"></div></div>
      </div>
    </main>

    <!-- Overlays -->
    <div id="startOverlay" class="overlay">
      <div class="card">
        <div class="big">HIGH METER</div>
        <div class="sub">Tap the button to take hits before the blunt burns out. Button moves randomly.</div>
        <button id="beginBtn" class="btn">Tap to Begin</button>
      </div>
    </div>

    <div id="winOverlay" class="overlay hidden">
      <div class="card">
        <div class="big" style="color:#7dffa6;">YOU GOT HIGH ðŸŽ‰</div>
        <div class="sub">You filled the meter before the blunt went out.</div>
        <button id="playAgain" class="btn">Play Again</button>
      </div>
    </div>
  </div>

  <!-- Jumpscare (Lose) -->
  <div id="jumpscare">
    <div id="blackFade"></div>

<script>
(function(){
  /* ===== CONFIG ===== */
  const TOTAL_TIME = 30;        // seconds for blunt to burn
  const TARGET_HITS = 30;       // hits to win
  const MOVE_INTERVAL = 1200;   // ms button hop

  /* ===== ELEMENTS ===== */
  const scoreEl = document.getElementById('score');
  const targetEl = document.getElementById('target');
  const burnRect = document.getElementById('burnRect');
  const ember = document.getElementById('ember');
  const hitBtn = document.getElementById('hitBtn');
  const puff = document.getElementById('puff');
  const meterFill = document.getElementById('meterFill');
  const startOverlay = document.getElementById('startOverlay');
  const beginBtn = document.getElementById('beginBtn');
  const winOverlay = document.getElementById('winOverlay');
  const againBtn = document.getElementById('playAgain');

  targetEl.textContent = TARGET_HITS;

  // Minimal SFX via WebAudio
  let ctx;
  function initAudio(){ try{ ctx = new (window.AudioContext||window.webkitAudioContext)(); }catch(e){ ctx=null; } }
  function beep(freq=420, dur=0.08){ if(!ctx)return; const t=ctx.currentTime; const o=ctx.createOscillator(); const g=ctx.createGain();
    o.type='square'; o.frequency.setValueAtTime(freq,t); g.gain.setValueAtTime(0.0001,t);
    g.gain.exponentialRampToValueAtTime(0.08,t+0.01); g.gain.exponentialRampToValueAtTime(0.0001,t+dur);
    o.connect(g).connect(ctx.destination); o.start(t); o.stop(t+dur+0.02);
  }

  let score=0, startTime=0, timerId=null, moverId=null, running=false;

  function layoutBlunt(progress){ // 0..1
    const maxWidth = 800, x0 = 40;
    const w = Math.round(maxWidth * progress);
    burnRect.setAttribute('width', w);
    const emberX = x0 + w;
    // avoid template strings to keep single-file generator happy
    ember.setAttribute('transform','translate(' + (emberX-40) + ',0)');
  }

  function updateTimer(){
    const elapsed = Math.min(TOTAL_TIME, (Date.now()-startTime)/1000);
    const p = elapsed / TOTAL_TIME;
    layoutBlunt(p);
    if (elapsed >= TOTAL_TIME) { endGame(false); return; }
    timerId = requestAnimationFrame(updateTimer);
  }

  function moveButton(){
    const w = window.innerWidth, h = window.innerHeight;
    const pad = 80;
    const x = pad + Math.random()*(w-2*pad);
    const y = pad + Math.random()*(h-2*pad);
    hitBtn.style.left = x+'px'; hitBtn.style.top = y+'px';
  }

  function puffFx(x,y){
    puff.style.left = (x-12)+'px'; puff.style.top = (y-12)+'px';
    puff.style.opacity=1;
    puff.animate([{transform:'scale(1)', opacity:1}, {transform:'scale(3)', opacity:0}], {duration:380, easing:'ease-out'});
    setTimeout(()=>{puff.style.opacity=0;}, 360);
  }

  function onHit(ev){
    if(!running) return;
    score++; scoreEl.textContent = score;
    meterFill.style.width = Math.min(100,(score/TARGET_HITS)*100)+'%';
    beep(500+Math.random()*120);
    moveButton();
    const t = ev.touches? ev.touches[0] : ev;
    puffFx(t.clientX, t.clientY);
    if (score >= TARGET_HITS) { endGame(true); }
  }

  function startGame(){
    initAudio();
    startOverlay.style.display='none';
    score=0; scoreEl.textContent=0; meterFill.style.width='0%';
    startTime = Date.now();
    running=true;
    moveButton();
    updateTimer();
    if (moverId) clearInterval(moverId);
    moverId = setInterval(moveButton, MOVE_INTERVAL + Math.random()*600);
  }

  function resetGame(){
    cancelAnimationFrame(timerId);
    if (moverId) clearInterval(moverId);
    running=false;
    layoutBlunt(0);
    startOverlay.style.display='grid';
    winOverlay.classList.add('hidden');
  }

  function endGame(win){
    running=false;
    cancelAnimationFrame(timerId);
    if (moverId) clearInterval(moverId);
    if (win) { winOverlay.classList.remove('hidden'); }
    else { triggerJumpscare(); }
  }

  beginBtn.addEventListener('click', startGame);
  againBtn.addEventListener('click', resetGame);
  hitBtn.addEventListener('click', onHit);
  hitBtn.addEventListener('touchstart', onHit);

  /* ===== JUMPSCARE ===== */
  const J = document.getElementById('jumpscare');
  const black = document.getElementById('blackFade');
  const faceWrap = document.getElementById('faceWrap');
  const face = document.getElementById('face');
  const scaryMusic = document.getElementById('scaryMusic');
  const staticFx = document.getElementById('static');
  const eyeL = document.getElementById('eyeL');
  const eyeR = document.getElementById('eyeR');
  const tapRestart = document.getElementById('tapRestart');

  function triggerJumpscare(){
    J.style.display='block';
    // Black fade
    black.animate([{opacity:0},{opacity:1}], {duration:1400, fill:'forwards'});
    setTimeout(()=>{ 
      faceWrap.style.opacity = 1;
      scaryMusic.volume=0.0;
      scaryMusic.play().catch(()=>{});
      let v=0; const volInt=setInterval(()=>{ v=Math.min(1,v+0.03); scaryMusic.volume=v; if(v>=1) clearInterval(volInt); }, 180);
      face.animate([{opacity:0},{opacity:1}], {duration:3800, fill:'forwards', easing:'ease-in'});
    }, 1400);

    // 7s creep
    setTimeout(()=>{ face.style.filter='brightness(.7) contrast(1.25) saturate(1.3)'; }, 7000+1400);

    // 10s glitch + static
    setTimeout(()=>{ face.classList.add('glitch'); staticFx.style.animation='flicker .6s infinite'; }, 10000+1400);

    // 20s calm
    setTimeout(()=>{ face.classList.remove('glitch'); face.style.filter='brightness(.45) contrast(1) saturate(.8)'; staticFx.style.animation='flicker 1.2s infinite'; }, 20000+1400);

    // 22s cursed
    setTimeout(()=>{ 
      face.classList.add('glitch'); 
      face.style.filter='brightness(1.9) contrast(3) saturate(5) hue-rotate(-160deg)';
      [eyeL,eyeR].forEach(e=>{ e.style.opacity=1; e.style.animation='eyePulse .9s infinite ease-in-out, eyeBurn 3s forwards'; });
      staticFx.style.animation='flicker .18s infinite'; staticFx.style.opacity=.3;
    }, 22000+1400);

    // allow restart
    setTimeout(()=>{ tapRestart.classList.remove('hidden'); J.addEventListener('click', onRestart, { once:true }); }, 24000);
  }

  function onRestart(){
    scaryMusic.pause(); scaryMusic.currentTime=0;
    face.classList.remove('glitch');
    face.style.filter='brightness(.4) contrast(1)';
    [eyeL,eyeR].forEach(e=>{ e.style.opacity=0; e.style.animation='none'; });
    staticFx.style.animation='none'; staticFx.style.opacity=0;
    tapRestart.classList.add('hidden');
    J.style.display='none';
    resetGame();
  }
})();
</script>
</body>
</html>
